import React from 'react';

function Navbar() {
  return (
    <div className="bg-csb-red flex gap-x-5 justify-center py-2">
      <p className='font-bold'>Dashboard</p>
      <p>Top Artists</p>
      <p>Top Tracks</p>
      <p>Recommendations</p>
      <div>
        <input type="text" />
      </div>
    </div>
  );
}

export default Navbar;
